// import './BlogCard.css';
import classes from './BlogCard.module.css';



const BlogCard = (props) => {
    console.log(props)
    return(
        <div className={classes.BlogCard}>
            <h3>{props.title}</h3>
            <p>{props.description}</p>
        </div>
    )
}

export default BlogCard;
